9/29/20 sent AB 1618 info
applied for commutation 3/20, req toolkit (added to mailing 7/22/20);
7-25-20: Sent toolkit, covid update, 1170d memorandum and info sheet

applied for commutation 8/2019; contacted TB while in prison in 2005; 
4/2020: Sent letter saying he is safe and thanking us for the resources we sent in which included update on COVID-19 & holistic self care guide, responded with more updated resources including spring newsletter, another self care guide, update on COVID-19, resources for filing 602's, medical form, etc.
-5/19/20: responding to letter addressed on 5/7/20 - shared that there are COVID-19 cases on his yard and was scared that he may have come into contact with it since he was in the presence of someone who tested positive, so far 2 folks tested positive and 1 guard on his yard, but upon the whole yard being tested, everyone including him is negative so far, said officers often don't wear their masks - sent in updated resources on covid, cdcr's response, spring 2020 newsletter, legal resources, and 602 guide; 8/03 sent YOP and update w/habeas info
